int main(void) {
  volatile int *switch_ptr = (int *)SW_BASE;
	volatile int *key_ptr = (int *)KEY_BASE;
	volatile int *timer_inter_ptr=(int *)0xfffec60c;

  srand(time(NULL));

	volatile int *pixel_ctrl_ptr = (int *)0xFF203020;

	*(pixel_ctrl_ptr + 1) = 0xC8000000; 
  while(1){
	wait_for_vsync();

	pixel_buffer_start = *pixel_ctrl_ptr;
	draw_start_background(); 
	*(pixel_ctrl_ptr + 1) = 0xC0000000;
	pixel_buffer_start = *(pixel_ctrl_ptr + 1);
  

  config_Timer();
  int time=0;

  while(1){
	  	draw_start_background();
		int switch_value=*switch_ptr;
		if(switch_value==1)
			break;
	}
	  
  draw_background();

  int old_laser_x_loc = -1;
	int old_laser_y_loc = -1;
  bool laser_drawn = false;
  int laser_x_loc;
  int laser_y_loc;
  int laser_x_dir;
  int laser_y_dir;
  int laser_dir;
  bool diag = false;
  
  while(1){
    if(*timer_inter_ptr==1){
		*timer_inter_ptr=0b1;
		time++;
	}
    int key_value = *key_ptr;
	  character_move(key_value);

    if(old_laser_x_loc != -1){
		  erase_laser(old_laser_x_loc,old_laser_y_loc,laser_dir, diag);  
	  }
    draw_time(time);
    draw_charater(character_x,character_y);
  	draw_health_bar(50);

    if(!laser_drawn){
      erase_laser(laser_x_loc,laser_y_loc,laser_dir, diag);
      laser_drawn = set_laser_direction(&laser_x_loc, &laser_y_loc, &laser_x_dir, &laser_y_dir);
    }

    determine_laser_direction(&laser_dir, laser_x_dir, laser_y_dir);
    
    if(laser_x_dir != 0 && laser_y_dir != 0){
       draw_laser_diag(laser_x_loc,laser_y_loc, laser_dir);
      diag = true;
    }else{
      draw_laser(laser_x_loc,laser_y_loc, laser_dir);
      diag = false;
    }

    old_laser_x_loc = laser_x_loc;
	  old_laser_y_loc = laser_y_loc;
    laser_x_loc += laser_x_dir;
    laser_y_loc += laser_y_dir;

    if(laser_x_loc < 0 || laser_x_loc > 320 || laser_y_loc < 0 || laser_y_loc > 240){
	 	 laser_drawn = false;
	  }
  
    wait_for_vsync();
    pixel_buffer_start = *(pixel_ctrl_ptr + 1);

  }
  }
}

void draw_background(){
  for(int i=0; i < 120; i++){
    for(int j=0; j < 160; j++){
      int index = (i*160 + j)*2;
      short int color = (short int)((background[index+1] << 8) & (0xFF00)) | (short int)(background[index] & 0xFF);
      for(int m=0; m<2; m++){
        for(int n=0; n<2; n++){
          plot_pixel(j*2+m,i*2+n,color);
          background_low[j*2+m][i*2+n] = color;
        }
      }
    }
	}
}

