void draw_line(int x0, int y0, int x1, int y1, short int line_color)
{	
	int y_step;
	int is_steep;
	if (abs(y1-y0) > abs(x1-x0))
	{
		is_steep=TRUE;
	}
	else
	{
		is_steep=FALSE;
	}
	
	if (is_steep==TRUE)
	{
		swap (&x0, &y0);
		swap (&x1, &y1);
	}
	if (x0 > x1)
	{
		swap (&x0, &x1);
		swap (&y0, &y1);
	}
	int deltax = x1 - x0;
	int deltay = abs(y1 - y0);
	int error = -(deltax/2);
	if(y0<y1)
		y_step = 1;
	else
		y_step = -1;
	int y=y0;
	for(int x = x0; x <= x1; x++)
	{
		if(is_steep==TRUE)
			plot_pixel(y, x, line_color);
		else
			plot_pixel(x, y, line_color);
		error = error + deltay;
		if(error>0)
		{
			y=y+y_step;
			error= error-deltax;
		}
	}
}

void wait_for_vsync()
{
	volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
	register int status;
	*pixel_ctrl_ptr = 1;
	status = *(pixel_ctrl_ptr + 3);

	while ((status & 0x01) != 0)
	{
		status = *(pixel_ctrl_ptr + 3);
	}
}

void swap(int * x, int * y)
{
	int temp = *x;
	*x = *y;
	*y = temp;
}

void determine_laser_direction(int *laser_dir, int laser_x_dir, int laser_y_dir){
	if(laser_x_dir != 0 && laser_y_dir != 0){
      if(laser_x_dir == 1){
        if(laser_y_dir == 1){
          *laser_dir = 1;
        }else if(laser_y_dir == -1){
          *laser_dir = 3;
        }
      }else if(laser_x_dir == -1){
        if(laser_y_dir == 1){
          *laser_dir = 2;
        }else if(laser_y_dir == -1){
          *laser_dir = 0;
        }
      }
    }else{
      if(laser_x_dir == 1){
        *laser_dir = 1;
      }else if(laser_x_dir == -1){
        *laser_dir = 3;
      }else if(laser_y_dir == 1){
        *laser_dir = 2;
      }else if(laser_y_dir == -1){
        *laser_dir = 0;
      }
    }
}

bool set_laser_direction(int *laser_x_loc, int *laser_y_loc, int *laser_x_dir, int *laser_y_dir){
  srand(time(NULL));
  bool drawn = true;
  
  int side = rand()%4;
  int diag = rand()%2;
  
  if(side == 0){
    if(diag){
      int num = rand()%2;
      if(num == 0){
        *laser_x_dir = 1;
        *laser_y_dir = 1;
      }else{
        *laser_x_dir = -1;
        *laser_y_dir = 1;
      }
    }else{
      *laser_x_dir = 0;
      *laser_y_dir = 1;
    }

    *laser_x_loc = rand()%319;
    *laser_y_loc = 0;
  }else if(side == 1){
    if(diag){
      int num = rand()%2;
      if(num == 0){
        *laser_x_dir = -1;
        *laser_y_dir = -1;
      }else{
        *laser_x_dir = -1;
        *laser_y_dir = 1;        
      }
    }else{
      *laser_x_dir = -1;
      *laser_y_dir = 0;
    }
    *laser_x_loc = 0;
    *laser_y_loc = rand()%239;
  }else if(side == 2){
    if(diag){
      int num = rand()%2;
      if(num == 0){
        *laser_x_dir = 1;
        *laser_y_dir = -1;
      }else{
        *laser_x_dir = -1;
        *laser_y_dir = -1;
      }
    }else{
      *laser_x_dir = 0;
      *laser_y_dir = -1;
    }
    *laser_x_loc = rand()%319;
    *laser_y_loc = 239;
  }else if(side == 3){
    if(diag){
      int num = rand()%2;
      if(num == 0){
        *laser_x_dir = 1;
        *laser_y_dir = -1;
      }else{
        *laser_x_dir = 1;
        *laser_y_dir = 1;
      }
    }else{
      *laser_x_dir = 1;
      *laser_y_dir = 0;
    }
    *laser_x_loc = 0;
    *laser_y_loc = rand()%239;
  }
  return drawn;
}

void plot_pixel(int x, int y, short int line_color)
{
	*(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void character_move(int key_value){
	if((key_value % 2==1) && character_x!=304){
		character_x++;
	}
	if((key_value % 4>=2) && character_y!=223){
		character_y++;
	}
	if((key_value % 8>=4) && character_y!=0){
		character_y--;
	}
	if((key_value >=8) && character_y!=0)
		character_x--;
}

void draw_time(int time){
	int hundreds = time/100;
	int tens=(time%100)/10;
	int ones=(time%100)%10;
	for(int i=0; i<10; i++){
		for(int j=0; j<6; j++){
			if(digit_color[hundreds][i/2][j/2]!=T)
				plot_pixel(142+j, 20+i, D);
		}
	}
	for(int i=0; i<10; i++){
		for(int j=0; j<6; j++){
			if(digit_color[tens][i/2][j/2]!=T)
				plot_pixel(150+j, 20+i, D);
		}
	}
	for(int i=0; i<10; i++){
		for(int j=0; j<6; j++){
			if(digit_color[ones][i/2][j/2]!=T)
				plot_pixel(158+j, 20+i, D);
		}
	}
}

